import React, {Component} from 'react';
import TopBar from './TopBar';
import Main from './Main';

import '../styles/App.css';

class App extends Component{
    render(){
        return (
            <div className="App">
                <TopBar />
                <Main />
            </div>
        )
    }
}
export default App;
